import React from 'react';
import ReactDOM from 'react-dom';
import { Routes,Route,BrowserRouter, NavLink } from 'react-router-dom';
import './index.css';
import App from './App';

function Home()
{
return(
  <NavLink to="/">App</NavLink>
)
}
ReactDOM.render(
  <>
  <BrowserRouter>
    <Routes>
      <Route path="/" component={App}></Route>
      </Routes>
    </BrowserRouter>
  </>,
  document.getElementById('root')
);
